script: |
  super -f text -I q4174.spq | sort > q4174.out

inputs:
  - name: q4174.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + col2 NOT BETWEEN - col2 / + col1 + + 6 * col0 - + 74 + + - 6 / + col2 AND - col1 * + ( + col1 ) * + - col1 * CAST ( NULL AS INTEGER ) * + col2 * + col0;
  - name: tab1

outputs:
  - name: q4174.out
    data: |
      51	14	96
      85	5	59
      91	47	68
